import { useRouter } from "next/router";

const User = () => {
  const router = useRouter();
  const { userid } = router.query;
  //console.log(userid);
  return <div>Profile</div>;
};

User.getInitialProps = async (ctx) => {
  console.log(ctx.query.id);
  return {
    data: null,
  };
};

export default User;
